INSERT INTO `calls` VALUES ('26f2ccb6-d220-b459-95d7-4d83906424a8','2011-03-18 17:01:53','2011-03-25 16:16:36','4','4','4','Estatus de muestras',0,15,'2011-03-18','20:00:00','2011-03-17','Accounts','Held','Outbound','474f9c01-1e44-232a-92f2-4d7d263593b7','Revisar el resultado de la aplicación de muestra de Sorbitol \r\nSe llamó a Liza Ureña comenta que el próximo 24 de Marzo tendrá resultados de algunas pruebas ya que recién retomaron los proyectos, se habían parado\r\n',0,300,NULL),('bb2bb0b4-d71c-4e61-0f74-4d89114a40f2','2011-03-22 21:15:35','2011-03-22 21:15:35','6','6','6','Servicio',5,0,'2011-03-23','15:30:00','2011-03-22','Accounts','Planned','Outbound','61329774-c032-8f2c-e511-4d7d282aec35','se llamara para ver que necesitan',0,-1,NULL),('80399b37-1a86-afab-46f5-4d892574aaa0','2011-03-22 22:42:36','2011-03-24 19:07:40','3','3','3','Agendar cita con Ing. Gamboa de Leorlen',0,15,'2011-03-22','18:30:00','2011-03-21','Accounts','Held','Outbound','f160089a-e2a9-74a7-6816-4d7adf83c0ff','Se hablo con Olivias, asistente del Ing. Gamboa para solicitarle una cita para darle seguimiento al consumo de Bioscour QP171, pero me comentó que el ing. Gamboa no se va a presentar a trabajar toda esta semana acordamos llamarnos el martes de la siguiente semana para coordinar la reunión.',0,-1,NULL),('1005b9dd-4a6a-aa49-969f-4d8926e460fe','2011-03-22 22:44:06','2011-04-04 20:31:56','3','3','3','Agendar cita con Ing. Gamboa de Leorlen',0,15,'2011-03-29','18:30:00','2011-03-28','Accounts','Held','Outbound','f160089a-e2a9-74a7-6816-4d7adf83c0ff','Acordamos hablar el martes 29 con la srta. Olivia para coordinar reunión con Ing. Gamboa. Nos confirmo la cita el Ing. Gamboa para el jueves 7 de abril a las 11:30.',0,-1,NULL),('72d6b1e5-4e3c-98bf-fc00-4d8926848c86','2011-03-22 22:46:54','2011-03-24 19:07:03','3','3','3','Envio de Biostone DS100 a Zafre',0,15,'2011-03-22','22:15:00','2011-03-21','Accounts','Held','Outbound','eed33076-57a5-d86b-f54b-4d7dc1295c6c','Hablamos con Franco Franceschy de Zafre, para coordinar envío de un tambor de Biostone DS100, me comentó que el precio del producto es mas caro que lo que utiliza, que antes de enviarle el tambor, Pepe corra otra prueba para costear la aplicación y ver comprobar  el desempeño del producto. Pepe lo visitara el proximo jueves para hacer pruebas nuevamente con Biostone DS100',0,-1,NULL),('27040dd0-f34c-ac91-8432-4d8a6c5dc2a5','2011-03-23 21:57:26','2011-03-24 19:08:34','3','3','3','Cobro en Vaquintex',0,15,'2011-03-23','17:00:00','2011-03-22','Accounts','Held','Outbound','3903057f-9f52-550a-0918-4d7dc063c9a6','Se hablo con Javier Vargas para cobro de una factura atrasada, nos dijo que el proximo viernes liquida la factura para ver si es posible le entregemos producto.\r\nHablaremos con el el próximo viernes.',0,-1,NULL),('f367a66c-f115-f12a-b74f-4d8a6e8ef73a','2011-03-23 22:06:15','2011-03-24 19:10:51','3','3','3','Cita con Italo Perich',0,15,'2011-03-23','15:15:00','2011-03-22','Accounts','Held','Outbound','77a40916-2e55-e688-63e3-4d7d26e26539','Hablamos con la srita. Silvia Romero de Miro para darle seguimiento a programar reunión con Italo Perich, acordamos enviarle un correo explicandole el motivo de la visita y despues hablarnos para  ver si nos da fecha de pruebas. Hablaremos con ella el proximo viernes ',0,-1,NULL),('2cb6150d-4b4e-a481-c337-4d8a6f274d28','2011-03-23 22:07:01','2011-03-28 23:04:06','3','3','3','Cita con Italo Perich',0,15,'2011-03-25','15:15:00','2011-03-24','Accounts','Held','Outbound','77a40916-2e55-e688-63e3-4d7d26e26539','Darle seguimiento a la cita con Italo Perich. El día de hoy hable con Silvia Romero asistente de Italo Perich para darle seguimiento a la reunion con el pero todavía no le ha dado fecha, acordamos hablarle el proximo viernes.\r\n',0,-1,NULL),('d1a22f8c-21c6-2b8a-46b0-4d8a76f2d801','2011-03-23 22:39:52','2011-03-23 22:39:52','4','4','4','Estatus de pruebas en producción de Novoshape',0,10,'2011-03-23','17:15:00','2011-03-22','Leads','Held','Outbound',NULL,'Se realizo llamada con el Ing Fernando Muñoz, Jefe de producción de Congeladora Bonfil, se le solicito información respecto al estatus de la aplicaciópn de Novoshape en fresa a un lote de producción, pero comento que aunque ya le solicitaron un embarque de 940 cubetas de fruta, no se le permitio la adición de Novoshape, comentó que exiiste la posibilidad de probar con otro cliente pero falta la retroalimentación, para saber si autoriza o no la adición de Novoshape.',0,-1,NULL),('6c2c7f17-712b-ecfc-b4c6-4d8a78d00e0c','2011-03-23 22:48:42','2011-03-23 22:48:42','4','4','4','Estatus de proyecto de mejoradores de masas',0,10,'2011-03-23','17:30:00','2011-03-22','Leads','Held','Outbound',NULL,'S llamo a la gente del comisariato Toks para dar seguimiento a la parte del proyecto para la aceptación del mejorador de masas de pan blanco por parte de subdirección y dirección de Comisariato Toks\r\n\r\nS tuvo contacto con Liliana Villalda y comenta que se retraso su presentación y no ha sido posible estima que talvez a fin de mes aprovechen su reunión mensual para hacer la presentación pero nada seguro. Se comprometió a retroalimentarnos en cuanto se haga la reunión',0,-1,NULL),('df55ee52-e70e-d513-31e2-4d8a7ccecc76','2011-03-23 23:04:17','2011-03-23 23:04:17','4','4','4','Solicitud de productos para licuefacción de grasas',0,10,'2011-03-22','15:15:00','2011-03-21','Accounts','Held','Inbound',NULL,'Llamo la Srita Viviana Martínez solicitando una recomendacción de un producto que sirva para licuar la grasa ya que tienen problemas en sus trampas de grasa, se le ofreció visitarla, hoy mismo a las 14:00 hrs',0,-1,NULL),('c4f5ffed-bb2f-749d-afdb-4d8a86b5b2db','2011-03-23 23:47:57','2011-03-25 16:17:09','4','4','4','Solicitud de cotizaciones de productos a Sra Najar',1,0,'2011-03-23','15:00:00','2011-03-22','Accounts','Held','Outbound',NULL,NULL,0,-1,NULL),('1f741e6c-c2b3-d70d-8756-4d8d2b879204','2011-03-25 23:55:07','2011-03-25 23:55:14','4','4','4','Seguimiento a envío de coti