ccounts','Held',NULL,'Realizar las pruebas de panificación para aplicación de supersoft, con el Sr Jacinto, y conocer sus condiones de aplicación, efectos sobre el producto terminado, y los pasos para la elaboración de pan de caja.\r\n\r\nSe hizo la revisión de ingredientes la preparación de esponjas, y amasado, pendiente hacer una sesión 100% practica, \r\n\r\nSe reviso prueba de tortilla con harina Maseca',0,-1,NULL),('337615c2-1b6e-6f5e-ea96-4dacbb9ee3dc','2011-04-18 22:30:26','2011-04-25 15:45:52','4','4','4','Pruebas de elaboración de bolillo','Panaderia',1,0,'2011-04-19','13:30:00','2011-04-18','Accounts','Held',NULL,'Realizar pruebas para aplicación de aditivos en bollillo así como identificar, los puntos finos del proceso, ire en compañia de Ulises Morales\r\n\r\nSe realizaron pruebas aplicando 3 mejoradores diferentes , Bolimix, Ultrapan 3000, y Toupan de Puratos, se obtuvieron mejores resultados con el Ultrapan, se encontró que de loque se hace diferente es la adición de azucar al final, y la forma en la que se hace el moldeo del bolillo, posterior a ese moldeo se realiza un reposo de 45 min aprox y depues se realiza un suaje, con un corte sobre la masa no muy profundo y ligeramenta transversal, para permitir el greñado, es importante que la masa este más apretada para que se ueda dar ese greñado.\r\n\r\nSe realizaron las pruebas en conjunto con el personal de la panaderia Delipan y por parte de Biotecsa, Ulises Moreles y Alfonso López\r\n',0,-1,NULL),('d024069c-481e-25ea-7f98-4db597b03086','2011-04-25 15:45:58','2011-04-25 15:45:58','4','4','4','Pruebas de elaboración de bolillo','Panaderia',1,0,'2011-04-19','13:30:00','2011-04-18','Accounts','Held',NULL,'Realizar pruebas para aplicación de aditivos en bollillo así como identificar, los puntos finos del proceso, ire en compañia de Ulises Morales\r\n\r\nSe realizaron pruebas aplicando 3 mejoradores diferentes , Bolimix, Ultrapan 3000, y Toupan de Puratos, se obtuvieron mejores resultados con el Ultrapan, se encontró que de loque se hace diferente es la adición de azucar al final, y la forma en la que se hace el moldeo del bolillo, posterior a ese moldeo se realiza un reposo de 45 min aprox y depues se realiza un suaje, con un corte sobre la masa no muy profundo y ligeramenta transversal, para permitir el greñado, es importante que la masa este más apretada para que se ueda dar ese greñado.\r\n\r\nSe realizaron las pruebas en conjunto con el personal de la panaderia Delipan y por parte de Biotecsa, Ulises Moreles y Alfonso López\r\n',0,-1,NULL),('2845e16e-259e-b1a7-8940-4db5ad98ce4d','2011-04-25 17:20:30','2011-04-25 17:20:30','5','5','5','Showroom Bimbo','Azcapotzalco',2,0,'2011-04-20','15:30:00','2011-04-19','Accounts','Held','33e6cd8f-cdd4-9a0b-fc52-4d7d217f98fe','Realizar la presentación al area tecnica de los refirzadores, suavisantes y reductor de aceite',0,-1,NULL),('62ad0d30-e1a9-bb4e-6f97-4db5ad82120a','2011-04-25 17:21:57','2011-04-25 17:21:57','5','5','5','Junta Compras',NULL,1,0,'2011-04-20','21:00:00','2011-04-19','Accounts','Held','f29f34e4-c982-5741-c575-4d7adef2f4b9','Revisar el pago de factura y programación de pedidos',0,-1,NULL),('a0f3cf02-04ca-7e3c-0aa2-4db75128ab5d','2011-04-26 23:14:14','2011-05-02 13:54:46','4','4','4','Visita a MVR','MVR Pedregal de Sn Nicolas',1,0,'2011-04-27','20:00:00','2011-04-26','Accounts','Held',NULL,'Visita de presentación de biotecsa y presentación de productos de Biotecsa para aplicar en producto biológico, para desinfección, quieren enzima para ayudar a eliminar y degradar olores.\r\n\r\nSe realizó la visita a MVR y se contacto con el CP Jose Luis Márquez, quién es el Direcor General, se hizo la presentación de Biotecsa y se le dieron a conocer los productos de enzimas que se tienen para detergentes, también se le ofrecieron algunas bacterias para control de olores.\r\n\r\nSe acordo se enviaría la información de bacterias y de una enzima para aplicación en detergentes.\r\n',0,-1,NULL),('5eff9fab-e1ba-9fd8-8faf-4db752ab58c3','2011-04-26 23:16:11','2011-05-02 13:44:37','4','4','4','Entrega de muestras visita a Probamex','Probamex Alce Blanco',1,0,'2011-04-27','17:00:00','2011-04-26','Accounts','Held',NULL,'Entrega de muestras de viscozyme L y novoferm 61 para la hidrólisis de harina de soya.\r\n\r\nSeguimiento a pruebas de hidrólisis de almidon',0,-1,NULL),('3281c91c-b90e-d4cd-4367-4dbeb58771e1','2011-05-02 13:47:30','2011-05-02 13:47:35','4','4','4','Entrega de muestras visita a Probamex','Probamex Alce Blanco',1,0,'2011-04-27','17:00:00','2011-04-26','Accounts','Held',NULL,'Entrega de muestras de viscozyme L y novoferm 61 para la hidrólisis de harina de soya.\r\n\r\nSeguimiento a pruebas de hidrólisis de almidon\r\n\r\nSe hablo con el Ing Jose Aleman y se ele entregaron las muestras comentó que se realizarían las pruebas para aplicar estas dos enzimas y compararlas con el desempeño del ceremix 6x que se le había entregado anteriormente.\r\n\r\nSolicito que nos comunicaramos con el Ing Alemán ya que tiene dudas en la aplicaición de la enzima, y no ha obtenido el producto que desea.\r\n\r\nSe acordo que se le devolvería la llamada mañana por la mañana.',0,-1,NULL),('2be077dc-858f-d62e-a8e8-4dbeb7bde2ce','2011-05-02 13:54:52','2011-05-02 13:54:52','4','4','4','Visita a MVR','MVR Pedregal de Sn Nicolas',1,0,'2011-04-27','20:00:00','2011-04-26','Accounts','Held',NULL,'Visita de presentación de biotecsa y presentación de productos de Biotecsa para aplicar en producto biológico, para desinfección, quieren enzima para ayudar a eliminar y degradar olores.\r\n\r\nSe realizó la visita a MVR y se contacto con el CP Jose Luis Márquez, quién es el Direcor General, se hizo la presentación de Biotecsa y se le dieron a conocer los productos de enzimas que se tienen para detergentes, también se le ofrecieron algunas bacterias para control de olores.\r\n\r\nSe acordo se enviaría la información de bacterias y de una enzima para aplicación en detergentes.\r\n',0,-1,NULL),('a5641f9f-a1a6-28f1-6fa2-4dc15730b441','2011-05-04 13:42:38','2011-05-04 13:42:44','4','4','4','Entrega de muestra de Biogluzyme','Probamex',1,0,'2011-05-03','17:00:00','2011-05-02','Accounts','Held',NULL,'Se tendrá una reunión con el Ing Marcos Báez, de investigación y desarrollo para entregar muestra de Biogluzyme (glucoamilasa), para su proyecto de hidrólis de almidón a aprtir de la fécula de maíz.\r\n\r\nSe tuvo una reunión con el Ing Báez y nos comento que le gustó mucho el funcionamiento del Bioalfazyme (Termamyl 120 L), pero para poder completar su proceso y obtener el jarabe de glucosa, se le recomendo el uso de Biogluzyme para que se pudiera sacarificar, comento que correran las pruebas con estas enzimas para el próximo Martes.',0,-1,NULL),('aefacf84-56cd-3580-1a3c-4dc1575bdf1a','2011-05-04 13:42:49','2011-05-04 13:42:49','4','4','4','Entrega de muestra de Biogluzyme','Probamex',1,0,'2011-05-03','17:00:00','2011-05-02','Accounts','Held',NULL,'Se tendrá una reunión con el Ing Marcos Báez, de investigación y desarrollo para entregar muestra de Biogluzyme (glucoamilasa), para su proyecto de hidrólis de almidón a aprtir de la fécula de maíz.\r\n\r\nSe tuvo una reunión con el Ing Báez y nos comento que le gustó mucho el funcionamiento del Bioalfazyme (Termamyl 120 L), pero para poder completar su proceso y obtener el jarabe de glucosa, se le recomendo el uso de Biogluzyme para que se pudiera sacarificar, comento que correran las pruebas con estas enzimas para el próximo Martes.',0,-1,NULL),('1e8204b9-994f-d1d1-f851-4dd128d3b20d','2011-05-16 13:37:49','2011-05-16 22:45:11','4','4','4','Reunion de uso de enzimas p pet food','sala de juntas Biotecsa',2,0,'2011-05-16','16:00:00','2011-05-15','Accounts','Held',NULL,'Se realizará una reunión para revisar la información que se tienen disponible para el uso de enzimas que se aplican en Pet food con el Dr Villanueva.\r\n',0,-1,NULL),('65c502e3-cc6b-a10d-b7b9-4dd1a934b639','2011-05-16 22:46:26','2011-05-16 22:46:30','4','4','4','Reunion de uso de enzimas p pet food','sala de juntas Biotecsa',2,0,'2011-05-16','16:00:00','2011-05-15','Accounts','Held',NULL,'Se realizará una reunión para revisar la información que se tienen disponible para el uso de enzimas que se aplican en Pet food con el Dr Villanueva.\r\n\r\nSe tuvo una plática con el Dr Villanueva, y se recabo información del Seminario de Alimento para mascotas en Guadalajara.',0,-1,NULL),('1b8d0cc7-9352-d685-127f-4dd1a991ca47','2011-05-16 22:46:40','2011-05-16 22:46:40','4','4','4','Reunion de uso de enzimas p pet food','sala de juntas Biotecsa',2,0,'2011-05-16','16:00:00','2011-05-15','Accounts','Held',NULL,'Se realizará una reunión para revisar la información que se tienen disponible para el uso de enzimas que se aplican en Pet food con el Dr Villanueva.\r\n\r\nSe tuvo una plática con el Dr Villanueva, y se recabo información del Seminario de Alimento para mascotas en Guadalajara.',0,-1,NULL),('23a6b85d-a945-9683-3b56-4dd40e77d2c4','2011-05-18 18:24:41','2011-05-23 22:09:51','4','4','4','Visita de Servicio PFS','Profusa, Zamora Michoacán',1,0,'2011-05-19','21:00:00','2011-05-18','Accounts','Held',NULL,'Se tendra una reunión de servicio con el Ing Xictencatl, y se revisarán alginos puntos, como son obtener un nuevo pedido, entrega de carta a Srita Ayadeth, y firma de cursos que se impartieron en febrero.\r\n\r\nSe tuvo reunión con Srita Karina Campos, se firmaron los registros de los cursos que se dieron en febrero de Enzimología Básica.\r\n\r\nNos reunimos con Srita Ayadeth Ascencio, Jefe de compras de Profusa y nos comento que el pedido que realizaron al inicio de temporada, consideraba toda la temporada, por lo que no se levantaría otro pedido sino hasta noviembre, para la próxima temporada.\r\n\r\nSe tuvo una reunión con el Ing Xicotencatl González, y los Ing.\'s Ricardo y Rogelio, de producción e Investigación y desarrollo, respectivamente para platicar sobre las muestras de pectinex, en una aplicación de Arándanos, nos comentan que los resultados obtenidos no tuvieron significancia en el desempeño mostrado, la forma en que les ha funcionado es haciendo una modificación en su proceso, para porder abrir la capa del arándano y asi estabilizar la parte de gomas y pectinas con el entorno.\r\n\r\nPor otra parte nos comentaron que les interesa eliminar la sensación de \"arenosidad\" en una bebda de arandano y este es un proyecto que esta en standby, ya que despues de moler la fruta se han dado cuenta que se tiende a separar en 2 fases y la parte mas sólida se siente arenosa. se acoordo que se revisaría que produco le podríamos ofrecer para este problema.',0,-1,NULL),('81664f9c-8d9e-9395-be02-4dd40f47b4b4','2011-05-18 18:26:27','2011-05-23 22:28:47','4','4','4','Visita de Servicio BNF','Planta de Bonfil, ',1,0,'2011-05-19','17:00:00','2011-05-18','Accounts','Held',NULL,'Visita de seguimiento a bonfil para revisar la compra del Novoshape.\r\n\r\nSe realizó una visita con el Ing Francisco Muñoz, Gerente de Producción de congeladora Bonfil. Respecto a ala situación actual de la fresa comenta que no hay fruta disponible y que su producción esta muy baja, ahora por petición de sus clientes no ha sido posible introducir la enzima, ellos consideran que será hasta la proxima temporada cuando se pueda intentar utilizar la enzima,  se acordo se le llamaría en 15 días buscando hacer prueba de aplicación de Novoshape con otras frutas como son zarzamora y mango.',0,-1,NULL),('417eed7b-21b3-f86e-428e-4dd410c3e3ff','2011-05-18 18:29:20','2011-05-23 22:34:07','4','4','4','visita de Servicioa PAGR','Prodagri Jacona',1,0,'2011-05-20','17:00:00','2011-05-19','Accounts','Held',NULL,'Se acordoo una visita de seguimiento a ProdAgri para buscar realizar pruebas y se logre la venta de Novoshape.\r\n\r\nSe tuvo una visita con el Ing Jose Carlos Ramirez de ProdAgriy comento que por el mo0mento no esposible considerar una prueba de aplicación de Novoshape, y que tentativamente se podría aplicar entre el 20 y 24 de Junio se acordó en devolverle la llamada en 15días para dar seguimiento y considerar la prueba lo antes posible\r\n',0,-1,NULL),('d26f823f-56c9-7843-4afa-4dd411422921','2011-05-18 18:37:31','2011-05-24 21:21:01','4','4','4','Visita de Servicio PANFRUT','Frutamex, ',1,0,'2011-05-20','18:45:00','2011-05-19','Accounts','Held',NULL,'Dar seguimiento y programar pruebas con Pnafrut para aplicación de novoshape',0,-1,NULL),('d4d89e70-2047-fa9a-f7e0-4ddc2160b66d','2011-05-24 21:21:06','2011-05-24 21:21:06','4','4','4','Visita de Servicio PANFRUT','Frutamex, ',1,0,'2011-05-20','18:45:00','2011-05-19','Accounts','Held',NULL,'Dar seguimiento y programar pruebas con Pnafrut para aplicación de novoshape',0,-1,NULL),('88366d0f-330e-eaa0-87b5-4dd411457134','2011-05-18 18:37:45','2011-05-24 21:22:03','4','4','4','Visita de Servicio FTMX','Frutamex, ',1,0,'2011-05-20','15:45:00','2011-05-19','Accounts','Held',NULL,'Se ha buscado a Lic Blanca Galván, no ha sido posible encontrarla vía telefónica, se planea visitarla directamente aprovechando el viaje.\r\n\r\nSe visito la planta de Frutamex, pero no fue posible que nos atendiera la Lic Galván, de dos visitas que se realizaron en la primera nos atendio la srita Laura, de producción, y se le pidió información acerca de la orden de compra del Novoshape.\r\n\r\nEn la otra visita nos atendió el Lic Yuri Ortega de contabilidad y nos comento que la Lic Galván no me podía atender pero que respecto a la enzima le interesaba solo que era necesario revisar el costo, por lo que se acordo se enviaría una vez más la cotización, el % de aplicación y los numeros de cuenta a donde deporsitar, entonces ella revisaría los costos para poder extender la orden de compra ',0,-1,NULL),('8ba04d9e-ccc4-5494-6ab5-4dd41204e875','2011-05-18 18:39:58','2011-05-23 22:58:16','4','4','4','Visita de Servicio NTS','Nutres La Piedad Michoacan',1,0,'2011-05-19','16:00:00','2011-05-18','Accounts','Held',NULL,'Visita de servicio a Planta de Nutres para dar seguimiento a consumo de enzima para potenciar sabor.\r\n\r\nSe visitó al Ing Raúl Mejía y nos comentó que actualmente están consumiento 10 kg por mes de cada enzima (Bioteaste y Bioflavour), comentó que le interesa se le envíe información respecto al perfil de aminoación que se logra realizando la aplicación de nuestros productos.\r\n\r\nPor otra parte respectro a los consumos de enzima nos indico que hay altas probabilidades que se incremente al doble a finales del mes de Julio ya que se inscrementara el volumentde producción de su panta y harán otra planta que arrancara en septiembre Aprox.\r\n\r\nTambién comento que les interesa la parte de bacterias para digestores de lodos, ya uqe trabajan con residuos de puercos, en las granjas aproximadamente son 50, solicito  información al respecto.',0,-1,NULL),('973fc557-38de-6cd2-3dbe-4dd412ae0878','2011-05-18 18:40:54','2011-05-18 18:40:54','4','4','4','Visita de Servicio NTS','Nutres La Piedad Michoacan',1,0,'2011-05-19','16:00:00','2011-05-18','Accounts','Held',NULL,'Visita de servicio a Planta de Nutres para dar seguimiento a consumo de enzima para potenciar sabor.',0,-1,NULL),('1146b611-da94-6e59-1b45-4dd41273ae18','2011-05-18 18:41:02','2011-05-18 18:41:02','4','4','4','Visita de Servicio NTS','Nutres La Piedad Michoacan',1,0,'2011-05-19','16:00:00','2011-05-18','Accounts','Held',NULL,'Visita de servicio a Planta de Nutres para dar seguimiento a consumo de enzima para potenciar sabor.',0,-1,NULL),('5e5bafe0-00a3-3168-3727-4ddadb045cbe','2011-05-23 22:09:57','2011-05-23 22:09:57','4','4','4','Visita de Servicio PFS','Profusa, Zamora Michoacán',1,0,'2011-05-19','21:00:00','2011-05-18','Accounts','Held',NULL,'Se tendra una reunión de servicio con el Ing Xictencatl, y se revisarán alginos puntos, como son obtener un nuevo pedido, entrega de carta a Srita Ayadeth, y firma de cursos que se impartieron en febrero.\r\n\r\nSe tuvo reunión con Srita Karina Campos, se firmaron los registros de los cursos que se dieron en febrero de Enzimología Básica.\r\n\r\nNos reunimos con Srita Ayadeth Ascencio, Jefe de compras de Profusa y nos comento que el pedido que realizaron al inicio de temporada, consideraba toda la temporada, por lo que no se levantaría otro pedido sino hasta noviembre, para la próxima temporada.\r\n\r\nSe tuvo una reunión con el Ing Xicotencatl González, y los Ing.\'s Ricardo y Rogelio, de producción e Investigación y desarrollo, respectivamente para platicar sobre las muestras de pectinex, en una aplicación de Arándanos, nos comentan que los resultados obtenidos no tuvieron significancia en el desempeño mostrado, la forma en que les ha funcionado es haciendo una modificación en su proceso, para porder abrir la capa del arándano y asi estabilizar la parte de gomas y pectinas con el entorno.\r\n\r\nPor otra parte nos comentaron que les interesa eliminar la sensación de \"arenosidad\" en una bebda de arandano y este es un proyecto que esta en standby, ya que despues de moler la fruta se han dado cuenta que se tiende a separar en 2 fases y la parte mas sólida se siente arenosa. se acoordo que se revisaría que produco le podríamos ofrecer para este problema.',0,-1,NULL),('5d8ba4fd-1da9-b87e-c4c5-4ddadf519430','2011-05-23 22:28:55','2011-05-23 22:28:55','4','4','4','Visita de Servicio BNF','Planta de Bonfil, ',1,0,'2011-05-19','17:00:00','2011-05-18','Accounts','Held',NULL,'Visita de seguimiento a bonfil para revisar la compra del Novoshape.\r\n\r\nSe realizó una visita con el Ing Francisco Muñoz, Gerente de Producción de congeladora Bonfil. Respecto a ala situación actual de la fresa comenta que no hay fruta disponible y que su producción esta muy baja, ahora por petición de sus clientes no ha sido posible introducir la enzima, ellos consideran que será hasta la proxima temporada cuando se pueda intentar utilizar la enzima,  se acordo se le llamaría en 15 días buscando hacer prueba de aplicación de Novoshape con otras frutas como son zarzamora y mango.',0,-1,NULL),('b479ba2f-926a-deff-dec4-4ddae0d70c74','2011-05-23 22:34: