tán consumiento 10 kg por mes de cada enzima (Bioteaste y Bioflavour), comentó que le interesa se le envíe información respecto al perfil de aminoación que se logra realizando la aplicación de nuestros productos.\r\n\r\nPor otra parte respectro a los consumos de enzima nos indico que hay altas probabilidades que se incremente al doble a finales del mes de Julio ya que se inscrementara el volumentde producción de su panta y harán otra planta que arrancara en septiembre Aprox.\r\n\r\nTambién comento que les interesa la parte de bacterias para digestores de lodos, ya uqe trabajan con residuos de puercos, en las granjas aproximadamente son 50, solicito  información al respecto.',0,-1,NULL),('1b00b2fd-e541-c72b-be7c-4ddc22849fb0','2011-05-24 21:24:27','2011-05-24 21:25:28','4','4','4','Visita de Servicio a Duero',NULL,1,0,'2011-05-19','22:00:00','2011-05-18','Accounts','Held',NULL,'Visitar al Ing Vctor Ramirez y buscar hacer pruebas de aplicacion de Novoshape',0,-1,NULL),('4839ea09-b77d-d7ce-9717-4ddc2249afb4','2011-05-24 21:25:33','2011-05-24 21:25:33','4','4','4','Visita de Servicio a Duero',NULL,1,0,'2011-05-19','22:00:00','2011-05-18','Accounts','Held',NULL,'Visitar al Ing Vctor Ramirez y buscar hacer pruebas de aplicacion de Novoshape',0,-1,NULL),('1541df0a-a12b-b35d-4639-4de95db01517','2011-06-03 22:16:43','2011-06-24 15:59:11','4','4','4','Reunion con Procurement BIMBO','Planta Marinela',1,30,'2011-06-06','14:00:00','2011-06-05','Accounts','Held',NULL,'Reunión con personal de Bimbo para conocer el proceso de automatización de compras de Bimbo, y presentarlo a sus poovedores.\r\n\r\nSe tuvo la reunión con la gente de bimbo y se acordo enviar la información de la gente que se daría de alta como proovedor en su base de datos para asignar nobre de usuario, contrasela y capacitación en caso de ser necesario.',0,-1,NULL),('58b2a4bd-7a3d-3cee-a887-4de95db31261','2011-06-03 22:18:59','2011-06-24 16:00:41','4','4','4','Curso ABC de Panieficación','CANAINPA',4,0,'2011-06-06