aaf04a',NULL,0,0,NULL,0),('a271e8f4-060e-a760-b24e-4da70c9ff0df','2011-04-14 15:00:21','2011-04-14 15:00:21','8','8','Resumen de pruebas 13-04-11','DISPERSANTE-DESENGOMANTE APRESA.doc','application/msword','Project','da98c688-a937-a84e-5346-4da70a16bf3d',NULL,0,0,'Se anexa el reporte con los resultados de las pruebas del 13 de abril del 2011. Ver cuaderno de pruebas 3 con la fecha indicada.',0),('212307f4-f4bd-b8d3-5402-4da70c1dc022','2011-04-14 15:01:24','2011-04-14 15:01:24','8','8','Resumen de pruebas 13-04-11','DISPERSANTE-DESENGOMANTE APRESA.doc','application/msword','Project','b6b1f479-a79c-dd4f-6706-4d827a085d61',NULL,0,0,'Se anexa el reporte con los resultados de las pruebas del 13 de abril del 2011. Ver cuaderno de pruebas 3 con la fecha indicada.',0),('24c9eba6-5195-caf3-d79c-4daf2fec7af6','2011-04-20 19:08:47','2011-05-02 16:27:20','15','15','Reporte del mes de Abril 2011',NULL,NULL,'Project','97be5692-4db1-3add-d9d7-4d82597333b5',NULL,0,0,'Se adjunta el reporte parcial del mes de abril ',0),('a76b4615-5eb9-247a-9e77-4dbef1adf6b8','2011-05-02 18:01:53','2011-05-02 18:01:53','8','8','Plan de trabajo 25 abril-09 mayo','PLAN DE TRABAJO PRODUCTOS APRESA.xls','application/vnd.ms-excel','Project','b6b1f479-a79c-dd4f-6706-4d827a085d61',NULL,0,0,'Se anexa el plan de trabajo para la nueva gama de prodcutos que se esta desarrollando para Apresa, elaborado junto con Edgar Muñoz.',0),('15bd4b49-c79c-f8a7-e44a-4dca9ff9a873','2011-05-11 14:39:58','2011-05-11 14:39:58','7','7','Actualizacion Estatus 110511',NULL,NULL,'Project','c5b96b24-37e9-21c2-1a17-4d824d5e28f5',NULL,0,0,'Se esta esperando la respuesta de comercialización para el producto Biostone 362 Ultra. El producto es una formula mejorada con sistemas de limpieza recien evaluados. Por el momento no puede disminuirse su costo por reformulación. Pueden evaluarse proveedores alternos de los sistemas de limpieza para tratar de tener un menor costo.',0),('cc4133ab-088d-3bad-f448-4ddd0ed697a6','2011-05-25 14:13:39','2011-05-25 14:13:39','8','8','Pruebas en planta 23-05-11','APRESA desen-tall 23-05-11.doc','application/msword','Project','b6b1f479-a79c-dd4f-6706-4d827a085d61',NULL,0,0,'Se evaluó el sistema de densegomado-tallado con Apresa.',0),('ec15cb08-d15f-e2ed-7634-4ddd6c1ac8a8','2011-05-25 20:54:23','2011-05-25 20:57:05','2','2','Evaluación de desengomante APRESA 17/05/11','Desengomantebloqueador170511.pdf','application/pdf','Project','da98c688-a937-a84e-5346-4da70a16bf3d',NULL,0,0,'Se evaluó  el Biostone DS1000 en una carga de LEVIS, en un acabado 4891 a un % de  0.28%, tiempo 15 minutos y se logro un correcto desengomado. Se realizarán pruebas para hacer el desengome y tallado en un solo paso. Se tiene que presentar la propuesta económica para hacer el comparativo de costo beneficio.',0),('7407d271-7839-fa3f-b469-4ddd6df4f01a','2011-05-25 21:00:31','2011-05-25 21:03:43','2','2','Pruebas en planta APRESA 170511','Desengomantebloqueador170511.pdf','application/pdf','Project','b6b1f479-a79c-dd4f-6706-4d827a085d61',NULL,0,0,'Se evaluó el Biostone 560 con en un acabado 4891 a una dosificación de 0.42%. Se obtuvo buena limpieza en bolsa, en etiqueta de la talla, sin embargo, le falto un poco de limpieza en la etiqueta trasera.\r\nSe programará una pruebas en planta haciendo desengomado y tallado en un paso.',0);
