,'21:00:00','2011-05-04','15:00:00','3e24ca3b-43b4-c8fe-bb72-4d827bbabfc8','High','Se evaluo el desempeño del Dettex Special L: 290411 ya que llego fuera de especificación con un pH de 8.92 cuando el limite superior aceptable es de 8.5.\r\nEl resultado fue satisfactorio, el producto formulado (Desize Ultra 5000) queda dentro de especificación con un pH de 7.49, el limite superior es es 8.0, Rogelio Curiel hablará con el cliente para abrirlo un poco mas, hasta 8.5 para evitar caer en valores muy cercanos al limite.',1,1,NULL,'off',NULL,NULL,0,100,0),('a2cd690b-6c75-9927-d68a-4dc2d752b11c','2011-05-05 16:58:19','2011-05-20 14:22:57','8','8','8','Formulaciones con concentrados','In Progress','2011-05-17','17:00:00','2011-05-10','17:00:00','3e24ca3b-43b4-c8fe-bb72-4d827bbabfc8','Medium','Se sustituirán el Novozym  LTC y el Valumax 838 por formulaciones de Biotecsa usando los concentrados de Novozymes. Se partirá del Biostone 362 Ultra que ya se probó en Apresa con buen resultado.\r\n\r\nNOTA: En espera de los resultados de las pruebas en planta',1,1,NULL,'off',NULL,NULL,0,50,0),('dd00860b-45e1-d835-27cd-4dd67b491967','2011-05-20 14:32:51','2011-05-20 14:34:57','8','8','8','Fórmula renovada','Completed','2011-03-03','18:00:00','2011-02-22','18:00:00','c5b96b24-37e9-21c2-1a17-4d824d5e28f5','High','Partiendo de la ficha técnica del Novozym LTC se probarán nuevos sistemas de limpieza, además del uso de enzimas concentradas que nos permitan un beneficion en costo.',1,2,NULL,'off',NULL,NULL,100,100,0),('e675f856-c095-356e-de8f-4dcaaf6ba759','2011-05-11 15:45:51','2011-05-20 14:20:36','8','8','7','Evaluar Seycote Alterno','Completed','2011-05-11','17:00:00','2011-05-09','17:00:00','c5b96b24-37e9-21c2-1a17-4d824d5e28f5','High','Se evaluara el alterno de seycote de Robama para el producto',1,NULL,NULL,'off',40,8,100,100,0),('58c3f019-3b9d-2456-b1a8-4dcaf7764712','2011-05-11 20:55:49','2011-05-11 21:26:40','8','8','8','Efectividad del método y equipo','Completed','2011-05-12','17:00:00','2011-05-11','17:00:00','682c84c4-28be-8b12-a3e7-4d827aaaf04a','Medium','Es necesario evaluar el método de prueba que se esta usando debido a que no se observa diferencia en amarillamiento entre las pruebas, ni aun con un aumento muy alto en la dosificación de los productos.\r\n\r\n',1,3,NULL,'off',NULL,NULL,50,50,0),('8dc00bb6-fb12-1966-da9d-4ddd103bdb43','2011-05-25 14:20:10','2011-05-25 14:20:10','8','8','8','Repetición de pruebas desengomado-tallado','In Progress','2011-05-25','17:00:00','2011-05-24','17:00:00','b6b1f479-a79c-dd4f-6706-4d827a085d61','High','Se repitieron las pruebas en planta que se corrieron en Apresa el 23-05-11 con el objetivo de determinar si los resultados son reproducibles también en el laboratorio.',1,5,NULL,'off',NULL,NULL,100,70,0),('e0d09cdb-0a77-2f95-815f-4de6b0c595ef','2011-06-01 21:34:23','2011-06-01 21:34:23','7','7','7','Efecto de goma guar en resistencia','Completed',NULL,NULL,'2011-06-01','17:00:00','192a33d9-e289-1a23-2a2b-4d8278a7b74e','High','Se evaluaron las siguientes dosis de goma guar: 0, 0.25% y 0.5% con 340 mL de agua/250 g harina\r\n\r\nNo existe diferencia estadisticamente significativa en la resistencia, sin embargo, con la mayor dosis se obtuvo una tortilla más rigida probablemente debido al efecto de mayor absorción de agua',1,NULL,NULL,'off',NULL,NULL,100,0,0),('62a198cc-7ecb-fc63-0a1a-4de6b0420afd','2011-06-01 21:35:37','2011-06-01 21:35:37','7','7','7','Evaluación de variación de agua y goma guar','Not Started',NULL,NULL,'2011-06-02','17:00:00','192a33d9-e289-1a23-2a2b-4d8278a7b74e','High','Evaluar el efecto del uso de 0.5% de goma guar con diferentes dosis de agua (+5 y + 10%)',1,NULL,NULL,'off',NULL,NULL,100,0,0),('a7556c45-a66f-5061-04ba-4ded2e8a2b7c','2011-06-06 19:46:37','2011-06-06 19:47:26','7','7','7','Asesoria Jacinto Chavez GRUMA','Completed','2011-05-20','17:00:00','2011-05-20','17:00:00','97be5692-4db1-3add-d9d7-4d82597333b5','High','Asesoría acerca de los productos de GRUMA (bollo y bolillo)